import { Plane, Text } from '@react-three/drei'
import { Canvas } from '@react-three/fiber'
import { Controllers, Interactive, XR } from '@react-three/xr'
import React, { Suspense, useEffect, useRef, useState } from 'react'
import * as THREE from './Three.js'

import { ARButton } from './webxr/ARButton'
import { XRPlanes } from './webxr/XRPlanes'
function Box({ color, size, scale, children, ...rest }: any) {
  return (
    <mesh scale={scale} {...rest}>
      <boxBufferGeometry args={size} />
      <meshPhongMaterial color={color} />
      {children}
    </mesh>
  )
}

function Button(props: any) {
  const [hover, setHover] = useState(false)
  const [color, setColor] = useState<any>('blue')

  const onSelect = () => {
    setColor((Math.random() * 0xffffff) | 0)
  }

  return (
    <Interactive onHover={() => setHover(true)} onBlur={() => setHover(false)} onSelect={onSelect}>
      <Box color={color} scale={hover ? [0.6, 1, 0.6] : [0.5, 1, 2]} size={[0.8, 0.1, 0.1]} {...props}>
        <Suspense fallback={null}>
          <Text position={[0, 0, 0.06]} fontSize={0.05} color="#ff0" anchorX="center" anchorY="middle">
            Ge Gao's first try
          </Text>
        </Suspense>
      </Box>
      <Plane color='#000' scale={hover ? [1, 1, 1] : [0.5, 2, 2]} size={[1, 0.1, 3]} {...props} />
    </Interactive>
  )
}

const Room = () => {
  const rendererRef = useRef<THREE.WebGLRenderer | null>(null)
  const cameraRef = useRef<THREE.PerspectiveCamera | null>(null)
  const sceneRef = useRef<THREE.Scene | null>(null)

  useEffect(() => {
    // Renderer
    const renderer = new THREE.WebGLRenderer({ antialias: true, alpha: true })
    renderer.setPixelRatio(window.devicePixelRatio)
    renderer.setSize(window.innerWidth, window.innerHeight)
    renderer.xr.enabled = true
    document.body.appendChild(renderer.domElement)
    rendererRef.current = renderer

    // AR Button
    const arButton = ARButton.createButton(renderer, {
      requiredFeatures: ['plane-detection'],
    })
    document.body.appendChild(arButton)

    // Scene
    const scene = new THREE.Scene()
    sceneRef.current = scene

    // Camera
    const camera = new THREE.PerspectiveCamera(70, window.innerWidth / window.innerHeight, 0.01, 20)
    cameraRef.current = camera

    // Light
    const light = new THREE.HemisphereLight(0xffffff, 0xbbbbff, 3)
    light.position.set(0.5, 1, 0.25)
    scene.add(light)

    // XRPlanes
    const planes = new XRPlanes(renderer)
    scene.add(planes)

    renderer.setAnimationLoop(() => {
      if (scene && camera) {
        renderer.render(scene, camera)
      }
    })

    const onWindowResize = () => {
      camera.aspect = window.innerWidth / window.innerHeight
      camera.updateProjectionMatrix()
      renderer.setSize(window.innerWidth, window.innerHeight)
    }

    window.addEventListener('resize', onWindowResize)

    // Cleanup
    return () => {
      window.removeEventListener('resize', onWindowResize)
      document.body.removeChild(renderer.domElement)
      document.body.removeChild(arButton)
    }
  }, [])

  return null
}

export function App(){
  return(
  <>
  
    <Canvas>
      <XR>
        <ambientLight />
        <pointLight position={[10, 10, 10]} />
        <Button position={[0, 0.1, -0.2]} />
        <Room />
        <Controllers />
      </XR>
    </Canvas>
  </>
  )
}
